(function() {
    "use strict";

    var app = angular.module("filters", ["constants"]);

    app.filter('escape', function() {
        /* global window */
        return window.encodeURIComponent;
    });

    app.filter('unescape', function() {
        /* global window */
        return window.decodeURIComponent;
    });

    app.filter("split", function() {
        return function(input, splitChar, splitIndex) {
            if (input === undefined || input === "" ||
                splitChar === undefined || input === "" ||
                splitIndex > input.split(splitChar).length - 1) {
                return "";
            }
            return input.split(splitChar)[splitIndex];
        };
    });

    app.filter("appendUUID", function() {
        return function(input) {
            function s4() {
                return Math.floor((1 + Math.random()) * 0x10000)
                    .toString(16)
                    .substring(1);
            }
            return input + '-' + s4() + s4() + '-' + s4() + '-' + s4() + '-' +
                s4() + '-' + s4() + s4() + s4();
        };
    });

    app.filter("getLastElement", function() {
            return function(input, splitChar) {
                if (input === undefined || input === "" ||
                    splitChar === undefined || input === "") {
                    return "";
                }
                return input.split(splitChar)[input.split(splitChar).length - 1];
            };
        });

    app.filter("prettifyJson", function() {
        return function(input) {
            if (input === undefined || input === "") {
                return "";
            }
            var prettyJson = "";
            for (var key in input) {
                if (input.hasOwnProperty(key)) {
                    prettyJson += key + ": " + input[key] + "\n";
                }
            }
            return prettyJson;
        };
    });

    app.filter("executionStatusFilter", function() {
        return function(exs, statuses) {
            return exs.filter(function(exs) {
                if (statuses.indexOf(exs.status) !== -1) {
                    return true;
                }
                return false;

            });
        };
    });

    app.filter("getAllAfterEventId", function() {
        return function(eventHistory, knownEventId) {
            return eventHistory.filter(function(eh) {
                return (eh.id > knownEventId);
            });
        };
    });

    // used for simple date formatting with moment js
    // in case we need more from moment js might consider using https://github.com/urish/angular-moment
    app.filter("momentDate", ["moment", function(moment) {
        return function(date, format, tz) {
            if (!moment(date).isValid()) {
              return "";
            }
            if (tz) {
                return moment(date).tz(tz).format(format);
            } else {
                switch (moment.locale()) {
                    case "ja":
                        format = "ll dddd a h:mm:ss.SSS";
                        break;
                    case "fr":
                        format = "ll HH:mm:ss.SSS";
                        break;
                    case "ko":
                        format = "ll hh:mm:ss.SSS a";
                        break;
                    case "zh":
                    case "zh-cn":
                        format = "ll hh:mm:ss.SSS A";
                        break;
                    default:
                        format = "MMM D, YYYY hh:mm:ss.SSS A";
                        break;
                }
                return moment(date).format(format);
            }
        };
    }]);

    app.filter("momentDiffMs", ["moment", function(moment) {
        return function(endDate, startDate) {
            var end = moment(endDate);
            var start = moment(startDate);

            if (!end.isValid() || !start.isValid()) {
              return "";
            }
            return end.diff(start, 'milliseconds');
        };
    }]);

    app.filter("maxValue", function() {
        var defaultMaxValue = 1000;
        return function maxValueFilter(value, maxValue) {
            if (!angular.isNumber(maxValue)) {
                maxValue = defaultMaxValue;
            }
            if (!angular.isNumber(value) || value <= maxValue) {
                return value;
            }
            return maxValue + "+";
        };
    });
}());
