                        d3.select(this)
                            .classed("NotYetStarted", false)
                            .classed("Succeeded", false)
                            .classed("Failed", false)
                            .classed("Cancelled", false)
                            .classed("InProgress", false)
                            .classed("CaughtError", false)
                            .classed(status, true);
