(function() {
    "use strict";

    angular
        .module("StatemachineModule")
        .factory("BlueprintsService", ["$q", "SimpleWorkflowService",
            function($q, simpleWorkflowService) {

                var blueprintImgMap = {
                    "Hello world": "speech",
                    "Task timer": "tasktimer",
                    "Job status poller": "jobpoller",
                    "Choice state": "sign",
                    "Wait state": "clock",
                    "Retry failure": "retry",
                    "Catch failure": "catch",
                    "Parallel": "parallel",
                    "Map state": "parallel",
                    "Custom": "custom",
                    "default": "clipboard"
                };

                var blueprintDescriptionMap = {
                    "Hello world": "DESIGN_PATTERN_DESCRIPTION_HELLO_WORLD",
                    "Wait state": "DESIGN_PATTERN_DESCRIPTION_WAIT_STATE",
                    "Retry failure": "DESIGN_PATTERN_DESCRIPTION_RETRY_FAILURE",
                    "Parallel": "DESIGN_PATTERN_DESCRIPTION_PARALLEL_STATE",
                    "Map state": "DESIGN_PATTERN_DESCRIPTION_MAP_STATE",
                    "Catch failure": "DESIGN_PATTERN_DESCRIPTION_CATCH_FAILURE",
                    "Choice state": "DESIGN_PATTERN_DESCRIPTION_CHOICE_STATE",
                    "default": ""
                };

                function parseBlueprintRecord(fileName, definition) {
                    // Blueprint file names have the order of display as the prefix. For example, "1-Hello world".
                    var parsed = fileName.split("-");
                    var name = parsed[1];
                    return {
                        index: parseInt(parsed[0], 10),
                        name: name.replace(/\s/g, ""),
                        descriptionLocalizableId: blueprintDescriptionMap[name] || blueprintDescriptionMap.default,
                        definition: definition,
                        img: blueprintImgMap[name] || blueprintImgMap.default
                    };
                }

                return {
                    loadBlueprints: function loadBlueprints() {
                        return $q(function(resolve, reject) {
                            simpleWorkflowService.loadAwlBlueprints()
                                .success(function(blueprintRecords) {
                                    if (!blueprintRecords || blueprintRecords.error) {
                                        reject("ERROR_LOADING_BLUEPRINTS");
                                        return;
                                    }
                                    var blueprints = Object.keys(blueprintRecords)
                                        .map(function(fileName) {
                                            return parseBlueprintRecord(fileName, blueprintRecords[fileName]);
                                        })
                                        .filter(function(blueprint) {
                                            return blueprint.definition && blueprint.definition.length > 0;
                                        })
                                        .sort(function(left, right) {
                                            return left.index - right.index;
                                        });
                                    resolve(blueprints);
                                })
                                .error(function() {
                                    reject("ERROR_LOADING_BLUEPRINTS");
                                });
                        });
                    }
                };
            }
        ]);
})();
(function () {
    "use strict";

    angular
        .module("StatemachineModule")
        .factory("StarterPackService", ["$q", "$http", "$timeout", "SimpleWorkflowService",
            function ($q, $http, $timeout, simpleWorkflowService) {
                var starterPackBaseUrl = "/states/service/starterpack";
                var defaultListPacksErrorCode = "SAMPLE_PROJECT_LOAD_FAILED";
                var noAvailablePacksErrorCode = "NO_SAMPLE_PROJECTS";
                var describeStackDelay = 1000;
                var requestCancelledMessage = "Request was cancelled";
                var cachedStarterPackDefinitions = [];

                var packIdToNameTranslationIdMap = Object.freeze({
                    jsp: "JOB_STATUS_POLLER_PACK",
                    tt: "TASK_TIMER_PACK",
                    bjm: "MANAGE_BATCH_JOB_PACK",
                    ctm: "MANAGE_CONTAINER_TASK_PACK",
                    tdr: "TRANSFER_DATA_RECORDS_PACK",
                    cbt: "CALLBACK_TASK_PACK",
                    nwf: "NESTING_PATTERN_PACK",
                    dpp: "DYNAMIC_PARALLEL_PROCESSING_PACK",
                    tbt: "SAGEMAKER_TRAIN_MODEL_TRANSFORM_PACK",
                    hpt: "SAGEMAKER_HYPERPARAMETER_TUNING_PACK",
                    ejm: "MANAGE_EMR_JOB_PACK",
                    exq: "EXPRESS_SQS_PACK",
                    sc: "EXPRESS_SELECTIVE_CHECKPOINTING_PACK"
                });

                var packIdToDescriptionTranslationIdMap = Object.freeze({
                    jsp: "JOB_STATUS_POLLER_PACK_DESCRIPTION",
                    tt: "TASK_TIMER_PACK_DESCRIPTION",
                    bjm: "MANAGE_BATCH_JOB_PACK_DESCRIPTION",
                    ctm: "MANAGE_CONTAINER_TASK_PACK_DESCRIPTION",
                    tdr: "TRANSFER_DATA_RECORDS_PACK_DESCRIPTION",
                    cbt: "CALLBACK_TASK_PACK_DESCRIPTION",
                    nwf: "NESTING_PATTERN_PACK_DESCRIPTION",
                    dpp: "DYNAMIC_PARALLEL_PROCESSING_PACK_DESCRIPTION",
                    tbt: "SAGEMAKER_TRAIN_MODEL_TRANSFORM_PACK_DESCRIPTION",
                    hpt: "SAGEMAKER_HYPERPARAMETER_TUNING_PACK_DESCRIPTION",
                    ejm: "MANAGE_EMR_JOB_PACK_DESCRIPTION",
                    exq: "EXPRESS_SQS_PACK_DESCRIPTION",
                    sc: "EXPRESS_SELECTIVE_CHECKPOINTING_PACK_DESCRIPTION"
                });

                var packIdToDocumentationTextTranslationIdMap = Object.freeze({
                    exq: "EXPRESS_SQS_PACK_DOCUMENTATION_TEXT",
                });

                var packOrder = [
                    "jsp", "cbt", "bjm", "tdr", "tt", "ctm"
                ].reduce(function(packIndexMap, packId, index) {
                    packIndexMap[packId] = index;
                    return packIndexMap;
                }, {});

                function knownOrderComparator(packInfo1, packInfo2) {
                    var order1 = packOrder[packInfo1.id];
                    var order2 = packOrder[packInfo2.id];
                    if (order1 === undefined && order2 === undefined) {
                        return 0;
                    }
                    if (order1 === undefined) {
                        return 1;
                    }
                    if (order2 === undefined) {
                        return -1;
                    }
                    return order1 < order2 ? -1 : 1;
                }

                function toStarterPackInfo(packDescription) {
                    return {
                        id: packDescription.id,
                        stackName: packDescription.stackName,
                        nameTranslationId: packIdToNameTranslationIdMap[packDescription.id],
                        descriptionTranslationId: packIdToDescriptionTranslationIdMap[packDescription.id],
                        documentationUrl: packDescription.documentationUrl,
                        resources: packDescription.resources,
                        definition: packDescription.definition,
                        documentationText: packIdToDocumentationTextTranslationIdMap[packDescription.id]
                    };
                }

                function knownStarterPackPredicate(packDescription) {
                    return !angular.isUndefined(packIdToNameTranslationIdMap[packDescription.id]);
                }

                var stackPollerTimeouts = {};
                var pollerCancelSchedule = {};
                var activePollers = {};

                function createCFnStack(packId) {
                    return $q(function (resolve, reject) {
                        simpleWorkflowService.createCloudformationStack(packId)
                            .success(function (data) {
                                resolve(data.stackId);
                            })
                            .error(function (data, status) {
                                reject(data.message);
                            });
                    });
                }

                function describeCfnStack(stackId) {
                    return $q(function (resolve, reject) {
                        simpleWorkflowService.describeCloudformationStacks(stackId)
                            .success(function (response) {
                                var stack = response.stacks.filter(function (stack) {
                                    return stack.stackId === stackId;
                                })[0];

                                if (!stack) {
                                    reject("ERROR_DESCRIBING_STACK");
                                    return;
                                }
                                resolve(stack);
                            })
                            .error(function (data, status) {
                                reject(data.message);
                            });
                    });
                }

                function awaitStackCompletion(stackId) {
                    stackPollerTimeouts[stackId] = undefined;
                    if (pollerCancelSchedule[stackId] === true) {    // poller has been scheduled for cancellation
                        pollerCancelSchedule[stackId] = undefined;
                        return $q.reject(requestCancelledMessage);
                    }

                    return describeCfnStack(stackId)
                        .then(function (stackDescription) {
                            if (pollerCancelSchedule[stackId]) {    // poller was cancelled during "describe stack" request
                                pollerCancelSchedule[stackId] = undefined;
                                return $q.reject(requestCancelledMessage);
                            }

                            if (stackDescription.stackStatus === "CREATE_COMPLETE") {
                                return stackDescription;
                            }

                            if (stackDescription.stackStatus === "CREATE_IN_PROGRESS") {
                                var timeoutPromise = $timeout(function () {
                                    return awaitStackCompletion(stackId);
                                }, describeStackDelay);
                                stackPollerTimeouts[stackId] = timeoutPromise;
                                return timeoutPromise;
                            }

                            return $q.reject("ERROR_DESCRIBING_STACK");
                        });
                }

                function listStarterPacks(shouldSort) {
                    return $http.post(starterPackBaseUrl + "/list")
                        .then(function(response) {
                            // expect "data" to be an array of objects or null if there are no available packs
                            if (!angular.isArray(response.data) || response.data.length === 0) {
                                return $q.reject(noAvailablePacksErrorCode);
                            }

                            var starterPacks = response.data
                                .filter(knownStarterPackPredicate)
                                .map(toStarterPackInfo);
                            if (shouldSort) {
                                starterPacks.sort(knownOrderComparator);
                            }
                            return starterPacks;
                        }, function(errResponse) {
                            return $q.reject(errResponse.data.errorCode || defaultListPacksErrorCode);
                        });
                }

                return {
                    listStarterPacks: listStarterPacks,
                    startCreatingPackResources: function(packDescription) {
                        return createCFnStack(packDescription.id);
                    },
                    getStackCreationWait: function(stackId) {
                        if (!activePollers[stackId]) {
                            activePollers[stackId] = awaitStackCompletion(stackId);
                        }
                        return activePollers[stackId];
                    },
                    cancelStackCreationWait: function (stackId) {
                        pollerCancelSchedule[stackId] = true;
                        var timeoutPromise = stackPollerTimeouts[stackId];
                        if (!timeoutPromise) {
                            return;
                        }
                        $timeout.cancel(timeoutPromise);
                        stackPollerTimeouts[stackId] = undefined;
                    },
                    getStackOutputValue: function (stackDescription, outputKey) {
                        var output = stackDescription.outputs.filter(function (output) {
                            return output.outputKey === outputKey;
                        })[0];
                        return output && output.outputValue || undefined;
                    }
                };
            }
        ]);
})();
