    angular
        .module("CloudWatchModule")
        .factory("CloudWatchLogsService", ["$http", "$q", function($http, $q) {

            var CW_LOG_GROUP_VALID_CHARACTERS_REGEX = /[^\w-.\/#]/g;
            var CW_LOG_GROUP_VALID_NAME_REGEX = /^[\w.#\/-]{1,512}$/;

            function listLogGroups() {
                return $http.get("/states/service/cloudwatchlogs/listloggroups")
                    .then(function(response) {
                        if (!angular.isArray(response.data)) {
                            return [];
                        }
                        return response.data;
                    })
                    .catch(function(response) {
                        return $q.reject(response.data);
                    });
            }

            function createLogGroup(logGroupName) {
                return $http.post("/states/service/cloudwatchlogs/createloggroup", {
                    logGroupName: logGroupName
                })
                .then(function(response) {
                    return response.data;
                })
                .catch(function(response) {
                    return $q.reject(response.data || {});
                });
            }

            function isValidLogGroupName(logGroupName) {
                return angular.isString(logGroupName) && CW_LOG_GROUP_VALID_NAME_REGEX.test(logGroupName);
            }

            function generateLogGroupNameForStateMachine(stateMachineName) {
                var cloudWatchLogGroupName = stateMachineName.replace(CW_LOG_GROUP_VALID_CHARACTERS_REGEX, "");

                if (cloudWatchLogGroupName.length < 1) {
                    cloudWatchLogGroupName = "MyStateMachine";
                }

                return "/aws/states/" + cloudWatchLogGroupName + "-Logs";
            }

            return {
                listLogGroups: listLogGroups,
                createLogGroup: createLogGroup,
                isValidLogGroupName: isValidLogGroupName,
                generateLogGroupNameForStateMachine: generateLogGroupNameForStateMachine
            };
        }
    ]);
